import * as React from 'react';
import { XGrid ,useApiRef} from '@material-ui/x-grid';
import { useDemoData } from '@material-ui/x-grid-data-generator';
import {useSelector} from 'react-redux';
import axios from 'axios';
import { interval } from '  ';
export default function XGridDemo() {
    const columns = [
        { field: 'id', headerName: 'ID', width:'150px',},
        { field: 'HouseName', headerName: 'HouseName', width:'200px',},
        { field: 'HouseType', headerName: 'HouseType', width:'200px',},
        { field: 'Price', headerName: 'Price', width:'200px',},
        { field: 'PeopleNumber', headerName: 'PeopleNumber', width:'200px',},
        { field: 'BedNumber', headerName: 'BedNumber', width:'200px',},
        { field: 'Number_of_bedroom', headerName: 'Number_of_bedroom', width:'200px',},
        { field: 'Number_of_bathroom', headerName: 'Number_of_bathroom', width:'200px',},
        { field: 'People_max', headerName: 'People_max', width:'200px',},
        { field: 'Price_1_poeple_exceed', headerName: 'Price_1_poeple_exceed', width:'200px',},
        { field: 'Status', headerName: 'Status', width:'200px',  type: 'boolean',},
        { field: 'Address_ward', headerName: 'Address_ward', width:'200px',},
        { field: 'District', headerName: 'District', width:'200px',},
        { field: 'Province', headerName: 'Province', width:'200px',},
        { field: 'Description', headerName: 'Description', width:'200px',},

      ];

      const rows = [

      ];
      const [data, setData] = React.useState()
      const token = useSelector(state=>state.login.jwt);

      React.useEffect(()=>{

        // Request API.
        axios
          .get('http://localhost:1337/users', {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          })
          .then(response => {
            setData(response.data)
            console.log('Data: ', response.data);
          })
          .catch(error => {
            // Handle error.
            console.log('An error occurred:', error.response);
          });
      },[])

      const apiRef = useApiRef();

      React.useEffect(() => {
        const subscription = interval(200).subscribe(() => {
          apiRef.current.updateRows([data]);
        });

        return () => {
          subscription.unsubscribe();
        };
      }, [apiRef]);



  return (
    <div style={{ height: 520, width: '100%' }}>
      <XGrid

        // loading={data.rows.length === 0}
        // rowHeight={38}
        rows={data} columns={columns} apiRef={apiRef}
      />
    </div>
  );
}
